import React from 'react';
import ProjectPreview from '../components/ProjectPreview';
import Personal1 from '../images/project-snapshots/Personal-1.png';
import Econ1011 from '../images/project-snapshots/Econ101-1.png';
import Trig1 from '../images/project-snapshots/Trig-1.png';

const PortfolioPage = () => (
 <>
    <h1>Portfolio</h1>
    <p>Here’re a selection of some of my programming projects</p>

    <div class="grid-container-3">
      <ProjectPreview image={Personal1} title="Personal website (this site!)" description="I believe it’s a better version of my resume :)"/>
      <ProjectPreview image={Econ1011} title="Econ 101" description="Learn economics when have fun playing card memorization game. " />
      <ProjectPreview image={Trig1} title="Trig Crash Course" description="Study for your Algebra 2 Trig exams with casino games. " />
    </div>
 </>
);

export default PortfolioPage;
